import React from 'react';
import './modalWindowChooseTheme.css'
function ModalWindowChooseTheme(props) {
    function renderTheme() {
        console.log(props.themes);
        return props.themes.map(item =>{
            let listWords = item.list.map(word => {
                return(
                    <li style={{'list-style-type': 'none'}}><a className="active">{word.word}</a></li>
                )
            });
            return(
                <li style={{'list-style-type': 'none'}} ><a>{item.name}</a>
                    <ul className="submenu">
                        {listWords}
                    </ul>
                </li>
            )
        })
    }
    return (
        <div id="block">
            <ul  className="topmenu">
                {renderTheme() }
            </ul>

            <nav>
                <button onClick={() => console.log(renderTheme())}>x</button>
